import React, { useState } from "react";
import {Link} from "react-router-dom";

import {IntlProvider, FormattedMessage} from 'react-intl'
import { AiFillLinkedin, AiFillFacebook } from "react-icons/ai";

const messagesInFrench = {
 db:"DB",
admin:"ADMIN",
cash:"CASH",
bill: "BILL",
calculator: " RECEIPTS",
blog:"ACCOUNTS",
reports:"REPORTS",

}
const Header = ( ) => {


    const[click, setClick] = useState(false)

        const handleClick = () =>setClick(!click)


    return(

<IntlProvider messages={messagesInFrench} > 

      <nav className='flex justify-between items-center h-24 bg-blue-400 text-black relative shadow-lg lg:pl-24 lg:pr-24  text-lg fixed' role='navigation' >
      <Link to='/' className='pl-8  '>
      <img alt="Image is loading" className="align-middle border-none max-w-full h-auto rounded-lg"src="/Image/logo.png"/>
      </Link>

          <div className='pr-8 md:block flex  hidden   '>
          <Link to='/' className='p-4 hover:text-green-400 Link ' ><FormattedMessage id="db"/></Link>
          <Link to='/admin' className='p-4 hover:text-green-400  Link'><FormattedMessage id="admin"/></Link>
          <Link to="/cash" className='p-4 hover:text-green-400  Link'><FormattedMessage id="cash"/></Link>


          <Link to="/bill" className='p-4 hover:text-green-400  Link'><FormattedMessage id="bill"/></Link>
        <div className="menu-icon" onClick={handleClick}>
            <i className={click ? "fas fa-times": "fas fa-bars"} />

        </div>

          <Link to='/reports' className='p-4 hover:text-green-400 Link '><FormattedMessage id="reports"/></Link>


           </div>
           </nav>
           </IntlProvider>
    )

}

export default Header;
